import React,{useState, useEffect} from 'react';
import './App.css';
import Login from './pages/Login'
import Home from './pages/Home'
import useToken from './components/useToken'
import Register from './pages/Register'
import NewProduct from './pages/NewListing'
import {Routes,Route} from "react-router-dom"

function App() {

  const {token, setToken} = useToken();

  return(
    <>
    <Routes>
      <Route path='/' exact element={<Home token={token} setToken={setToken} />} />
      <Route path='/login' exact element={<Login setToken={setToken} token={token} />} />
      <Route path='/register' exact element={<Register token={token} />} />
      <Route path='/additem' exact element={<NewProduct token={token} setToken={setToken} />} /> 
    </Routes>
    </>
  );
}

export default App;
